import '../App.css';


function LandingPage() {
  async function handleClick() {
    const response = fetch('localhost:5000/auth/login');
    
  }



  return (
    <div className="hero">
      <button onClick={handleClick}>Login to Spotify</button>
    </div>
  );
}

export default LandingPage;
